const Header = () => {

  const {curr , setCurr } = CryptoState;
  console.log(curr);
  
  return (
    <>

    <div className="header">
      <div className="box1">
         <p>Crypto Hunt</p>
      </div>

      <div className="box2">
        <select value={curr} onChange={(e) => setCurr(e.target.value)}>
          <option value="INR">INR</option>
          <option value="INR">USD</option>
        </select>
      </div>

    </div>
      
    </>
  )
}

export default Header;
